<!DOCTYPE html>
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<html lang="en">

<head>
    <meta charset="UTF-8">
    <!-- Tambahkan link CDN untuk Tailwind CSS -->
    <link href="https://cdn.jsdelivr.net/npm/tailwindcss@2.2.19/dist/tailwind.min.css" rel="stylesheet">
    <title>Peta Berkedip</title>
    <style>
        .text-blue {
            color: #3b82f6;
        }

        @keyframes dot-blink {
            from {
                transform: scale(0);
                opacity: 1;
            }

            to {
                transform: scale(2);
                opacity: 0;
            }
        }

        .map {
            position: relative;
        }

        .map-bg {
            position: absolute;
            left: 0;
        }

        .map-dots {
            position: absolute;
            left: 0;
        }

        .dot {
            transform-origin: center;
            animation: dot-blink 1s linear infinite;
        }

        .dot:nth-child(1) {
            animation: dot-blink 3s linear infinite;
        }

        .dot:nth-child(3) {
            animation: dot-blink 4s linear infinite;
        }

        .dot:nth-child(5) {
            animation: dot-blink 4s linear infinite;
        }

        .dot:nth-child(7) {
            animation: dot-blink 3s linear infinite;
        }

        .dot:nth-child(9) {
            animation: dot-blink 5s linear infinite;
        }

        .dot:nth-child(11) {
            animation: dot-blink 3s linear infinite;
        }

        .dot:nth-child(13) {
            animation: dot-blink 3s linear infinite;
        }

        .dot:nth-child(15) {
            animation: dot-blink 4s linear infinite;
        }

        .dot:nth-child(17) {
            animation: dot-blink 3s linear infinite;
        }

        .dot:nth-child(19) {
            animation: dot-blink 4s linear infinite;
        }

        .dot:nth-child(21) {
            animation: dot-blink 5s linear infinite;
        }

        .dot:nth-child(23) {
            animation: dot-blink 3s linear infinite;
        }

        .dot:nth-child(25) {
            animation: dot-blink 4s linear infinite;
        }

        .dot:nth-child(27) {
            animation: dot-blink 2s linear infinite;
        }

        .dot:nth-child(29) {
            animation: dot-blink 1s linear infinite;
        }

        .flex-container {
            display: flex;
        }

        .flex-item {
            flex: 1;
            padding: 2rem;
        }

        .left-item {
            background-color: #edf2f7;
            /* Warna latar belakang kiri */
        }

        .right-item {
            background-color: #f7fafc;
            /* Warna latar belakang kanan */
        }
    </style>
</head>

